import { transferList,serviceTransfer } from '@/api/kefu'
export default {
    name: "transfer",
    props:{
        userUid:{
            type:String | Number,
            default:''
        }
    },
    data(){
        return{
            loading: false,
            currentChoose:'',
            labelLists: [],
            name:'',
        }
    },
    mounted() {
        this.getList()
    },
    methods:{
        getList(){
            transferList({
                nickname:this.name,
                uid:this.userUid
            }).then(res=>{
                this.labelLists = res.data.list
            })
        },
        bindActive(item){
            // this.$emit('transferPeople',item)
            if(this.userUid == ""){
                return this.$Message.error('转接失败')
            }
            serviceTransfer({
                uid:this.userUid,
                kefuToUid:item.uid
            }).then(res=>{
                this.$Message.success(res.msg)
                this.$emit('close')
            }).catch(error=>{
                this.$Message.error(error.msg)
            })
        }
    }
}
